import {Anime} from "./styled.js";
import Logo from "../../assets/images/logo.png";
import { Link } from "react-router-dom";

export default function Sign(){

    return(
        <Anime>
            <Lo src={Logo} alt="Logo Driven"/>
            <form>
                <input type="email" name="" id="" placeholder="E-mail"/>
                <input type="password" name="" id="" placeholder="Senha"/>
                <Link to="/subscriptions"><button disabled="">ENTRAR</button></Link>
            </form>
            <Link to="/sign-up"><span>Não possuí uma conta? Cadastre-se</span></Link>
        </Anime>
    );
};
